  \"Modoc National Wildlife Refuge pond bathymetry: Comparing bathymetric models generated
  from topographic data collected by recreational sonar fish finder and a Real-Time
  Kinematic Global Positioning System sensors in support of the USFWS Water Resources
  Inventory and Assessment Program\",\n\t\"tracking_summary\": {\n\t\t\"total\": 20,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:46:46.346843\",\n\t\"name\": \"modoc-national-wildlife-refuge-pond-bathymetry-comparing-bathymetric-models-generated-from\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study compared bathymetric models
  generated from topographic data collected with: 1) a recreational Lowrance HDS Gen
  2 sonar fish finder, and 2) a survey grade Real-time Kinematic (RTK)  GPS unit using
  traditional topographic surveying techniques, at the Middle 395 and Headquarters
  ponds at the Modoc National Wildlife Refuge (MNWR) in August and October of 2013.
  \ The purpose of the study was to assess the suitability of the fish finder, which
  is low cost, for generating bathymetric data from wetlands and ponds at the MNWR.Digital
  Elevation Models (DEMs) of each pond were developed from pond bottom topographic
  data generated through the RTK GPS and sonar surveys. A smoothed DEM was used for
  contour creation and for graphical display, but was not used for analysis. The magnitude
  of elevation differences was calculated between concurrent DEMs developed for each
  pond, and the distribution of these differences were analyzed.The sonar system was
  found to be preferable in ponds with areas larger than 4 hectares (10 acres) and
  deeper ponds with average depths greater than 0.6 m (2 ft) where the shallow water
  limitation is encountered less frequently and where an RTK survey would be resource
  intensive to implement.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
